  templateUrl: './registrar-gestor.component.html',
  styleUrls: ['./registrar-gestor.component.css']
})
export class RegistrarGestorComponent implements OnInit {

  gestor : Gestor = new Gestor();

  constructor(private clienteServicio:ClienteService, private router:Router, private httpClient:HttpClient) {}

  ngOnInit(): void{ }


  async guardarCliente() {
    try {
      const dato = await firstValueFrom(this.clienteServicio.registrarCliente(this.cliente));
      console.log(dato);
      this.irALaListaDeClientes();
    } catch (error) {
      console.log(error);
    }
  }

  irALaListaDeClientes(){
    this.router.navigate(['/clientes']);
  }

  onSubmit() {
    this.guardarCliente();
  }
}
